import Card from '../components/Card'
import Box from '@mui/material/Box';

const OutputWindow = ({...nodes}) => {
    if (nodes.length > 0) {
        return (
            <Card {...nodes}/>
        )
    } else {
        return (
            <Card/>
        )
    }
}

export default OutputWindow
